import React from "react";
import SkillItem from "./skillname.js"

const skillSet=[
    {
        name:"C++",
        stars:"4"
    },
    {
        name:"DSA",
        stars:"3"
    },
    {
        name:"HTML",
        stars:4
    },
    {
        name:"CSS",
        stars:4
    },
    {
        name:"Javascript",
        stars:3
    },
    {
        name:"React.js",
        stars:3
    },
    {
        name:"Node.js",
        stars:2
    },
    {
        name:"Express.js",
        stars:2
    },
    {
        name:"mongoDB",
        stars:2
    },

];

function createSkillSet(skillItem){
   return <SkillItem name = {skillItem.name} star = {skillItem.star}/>
}

function Skills(){
    return(
    <div id="skills" className="skills">
        <h1>Skills</h1>
        {skillSet.map(createSkillSet)}
        {/* <div className="skillsLeft">
        </div>
        <div className="skillsright">

        </div> */}
    </div>

    );
}

export default Skills;
